      <Link to={`/infos/${info.slug}`}>
        <img src={info.image} className='card-img-top' alt={info.name} />
      </Link>
      <Card.Body>
        {/* <Link to={`/infos/${info.slug}`}>
          <Card.Title>{info.name}</Card.Title>
        </Link> */}
        <Card.Text></Card.Text>
      </Card.Body>
    </Card>
  );
}
export default Info;
